  false,\n\t\"url\": null,\n\t\"notes\": \"Thermographs were deployed opportunistically
  in patches of deep coral at depths greater than 300 m.  Sites included the Makapuu
  precious coral bed, the Cross Seamount bed, the bed on the east extension of French
  Frigate Shoals and the black coral bed in the channel waters off Maui.   Some other
  shallower sites (<100 m) in the NWHI were instrumented for a shorter periods are
  included as separate files within the data set.\",\n\t\"license_title\": null,\n\t\"extras\":
